import React, { useState } from 'react';
import { Link, BrowserRouter as Router } from 'react-router-dom'; 
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faSearch } from '@fortawesome/free-solid-svg-icons'; 
import '../styles/Navbar.css'; 

function Navbar() {
    const [openMenu, setOpenMenu] = useState(null);

    const toggleMenu = (menu) => {
        setOpenMenu(openMenu === menu ? null : menu);
    };

    const closeMenu = () => {
        setOpenMenu(null);
    };

    return (
        <Router> 
            <nav className="navbar">
                <div className='logo-container'>
                    <h3 className='logo'>
                        KILIFI<span className='middle'>SPORTS</span>HUB!
                    </h3>
                </div>
                <ul className='menu'>
                    <li>
                        <Link to="/" onClick={closeMenu}><FontAwesomeIcon icon={faHome} /></Link>
                    </li>
                    <li>
                        <div className={`dropdown ${openMenu === 'about' ? 'open' : ''}`} onClick={() => toggleMenu('about')}>
                            <span>About</span>
                            {openMenu === 'about' && 
                                <ul className="submenu">
                                    <li><Link to="/about/our-vision">Our Vision</Link></li>
                                    <li><Link to="/about/our-mission">Our Mission</Link></li>
                                    <li><Link to="/about/location">Location</Link></li>
                                </ul>
                            }
                        </div>
                    </li>
                    <li>
                        <div className={`dropdown ${openMenu === 'events' ? 'open' : ''}`} onClick={() => toggleMenu('events')}>
                            <span>Events</span>
                            {openMenu === 'events' && 
                                <ul className="submenu">
                                    <li><Link to="/events/latest">Latest Events</Link></li>
                                    <li><Link to="/events/past">Past Events</Link></li>
                                </ul>
                            }
                        </div>
                    </li>
                    <li>
                        <div className={`dropdown ${openMenu === 'sports' ? 'open' : ''}`} onClick={() => toggleMenu('sports')}>
                            <span>Sports</span>
                            {openMenu === 'sports' && 
                                <ul className="submenu">
                                    <li><Link to="/sports/football">Football</Link></li>
                                    <li><Link to="/sports/volleyball">Volleyball</Link></li>
                                    <li><Link to="/sports/hockey">Hockey</Link></li>
                                    <li><Link to="/sports/netball">Netball</Link></li>
                                </ul>
                            }
                        </div>
                    </li>
                    <li><Link to="/support" onClick={closeMenu}>Support</Link></li>
                </ul>
                <Link to="/search" className='search-icon'>
                    <div className='search-icon'>
                        <FontAwesomeIcon icon={faSearch} />
                    </div>
                </Link>
                <Link to="/signup"><button className='signin-btn'>Signup/Login</button></Link>
            </nav>
        </Router>
    );
}

export default Navbar;
